import { getAgentDetailAPI } from '@/api/agentInformationApi.js';
export default {
  name: 'editor',
  data: function data() {
    return {
      // 规格列表
      pgid: '',
      genderlist: {
        0: "女",
        1: "男"
      },
      dataForm: {},
      imageShowUrl: '' // resourcesUrl: window.SITE_CONFIG.resourcesUrl

    };
  },
  components: {},
  props: {
    agentId: {
      required: true
    }
  },
  computed: {},
  methods: {
    errorMsg: function errorMsg(message) {
      this.$message({
        message: message,
        type: 'error',
        duration: 1500
      });
    },
    // 获取代理详细详情
    getAgentInfomationDetail: function getAgentInfomationDetail(id) {
      var _this = this;

      this.wholeLoding = true;
      getAgentDetailAPI(id).then(function (res) {
        var data = res.data.data;
        console.log(data);
        _this.dataForm = data;
      }).catch(function (err) {
        _this.wholeLoding = false;
      });
    },

    /*
      * 返回上层
      */
    backhtmls: function backhtmls() {
      this.$emit('close-form');
    }
  },
  mounted: function mounted() {
    this.getAgentInfomationDetail(this.agentId); // console.log(this.agentId)
  }
};
